PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "App_company" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(255) NOT NULL, "website" varchar(200) NOT NULL, "description" text NOT NULL, "location" varchar(100) NOT NULL, "logo" varchar(100) NULL, "user_id" integer NOT NULL UNIQUE REFERENCES "auth_user" ("id") DEFERRABLE INITIALLY DEFERRED, "is_complete" bool NOT NULL, "company_name" varchar(255) NULL, "phone" varchar(15) NOT NULL);
COMMIT;
